import { Divider, Typography, Form, Input, Button, Checkbox } from "antd";
import { UserOutlined, LockOutlined } from "@ant-design/icons";
import styled from "styled-components";
import { Link, useHistory } from "react-router-dom";
import { Auth } from "aws-amplify";
import { useContext, useEffect } from "react";
import { AuthStatusContext } from "../../../utils/AuthState";

const { Title } = Typography;
const { Item } = Form;

const StyledLoginDiv = styled.div`
  min-height: 100vh;
  padding: 72px;
  background: #fff;

  .login-title {
    text-align: center;
    margin-bottom: 20px;
  }

  .login-form {
    width: 500px;
    margin-top: 40px;
  }

  .login-form-forgot {
    float: right;
  }

  .ant-col-rtl .login-form-forgot {
    float: left;
  }

  .login-form-button {
    width: 100%;
  }

  .login-form-div {
    display: flex;
    justify-content: center;
  }
`;

const Login = () => {
  const { loggedIn, setLoggedIn } = useContext(AuthStatusContext);
  const history = useHistory();

  const onLogIn = async (values: any) => {
    try {
      await Auth.signIn(values.username, values.password);
      setLoggedIn(true);
      history.push("/results");
    } catch (error) {
      console.log("error logging in: ", error);
    }
  };

  return (
    <StyledLoginDiv>
      <Typography>
        <Title className="login-title" level={2}>
          Log In
        </Title>
      </Typography>
      <Divider />
      <div className="login-form-div">
        <Form
          name="normal_login"
          className="login-form"
          initialValues={{ remember: true }}
          onFinish={onLogIn}
        >
          <Item
            name="username"
            rules={[{ required: true, message: "Please enter your username" }]}
          >
            <Input
              prefix={<UserOutlined className="site-form-item-icon" />}
              placeholder="Username"
            />
          </Item>
          <Item
            name="password"
            rules={[{ required: true, message: "Please enter your password" }]}
          >
            <Input
              prefix={<LockOutlined className="site-form-item-icon" />}
              type="password"
              placeholder="Password"
            />
          </Item>
          <Item>
            <Item name="remember" valuePropName="checked" noStyle>
              <Checkbox>Remember me</Checkbox>
            </Item>
            <Link className="login-form-forgot" to="/signup">
              Forgot password
            </Link>
          </Item>
          <Item>
            <Button
              type="primary"
              htmlType="submit"
              className="login-form-button"
            >
              Log in
            </Button>
            Or <Link to="/signup">Sign Up</Link>
          </Item>
        </Form>
      </div>
    </StyledLoginDiv>
  );
};

export default Login;
